import './App.css';

function App() {
  return (
    <div className="App">
      <Navbar bg="dark" variant="dark">
          <Container>
            <Navbar.Brand href="#home">과일농장</Navbar.Brand>
            <Nav className="me-auto">
              <Nav.Link href="#home">홈으로</Nav.Link>
              <Nav.Link href="#detail">상세페이지</Nav.Link>
              <Nav.Link href="#cart">장바구니</Nav.Link>
            </Nav>
          </Container>
        </Navbar>
    </div>
  );
}

export default App;
